contract NAisiki is ERC20, ERC20Detailed {

    uint256 private _minimumSupply = 300000000 * (10 ** 18);
    

    /**
     * @dev Constructor that gives msg.sender all of existing tokens.
     */
    constructor () public ERC20Detailed("New Aisiki", "NAK", 18) {
        _mint(msg.sender, 85000000000 * (10 ** uint256(decimals()))); /* Project **/
        _mint(0x24b37aA84F317f7403d9B31E5772Fc85D9aae6EB, 4500000000 * (10 ** uint256(decimals()))); /* MTK **/
        _mint(0x7e581eeF3b07EA5Dc3073cB01af8B373cE647258, 3000000000 * (10 ** uint256(decimals()))); /* Destroyer 1 **/
        _mint(0x88D0354AC0e470E6e1B90c2c480Cb815115eA98b, 3000000000 * (10 ** uint256(decimals()))); /* Destroyer 2 **/
        _mint(0x640458301402bC1661C51c8e3C314Fcfdd9eE31D, 2000000000 * (10 ** uint256(decimals()))); /* Destroyer 3 **/
        _mint(0xD6B4Ab59294D42aB546F642594BE0b128Ee66Dec, 1000000000 * (10 ** uint256(decimals())));  /* DEV **/
        _mint(0x6e62d6cbEd3ac34da355CCb18bA92F54c7Bd5e9e, 500000000 * (10 ** uint256(decimals())));  /* Partner 1 **/
        _mint(0xed045e0bD6A3efd38B068de6f81A5D440d05FE66, 500000000 * (10 ** uint256(decimals())));  /* Partner 2 **/
        _mint(0xd988190457F1d776d71aA388428610ac0DA653d7, 500000000 * (10 ** uint256(decimals())));  /* Partner 3 **/
        
    }
    

    function transfer(address to, uint256 amount) public returns (bool) {
        return super.transfer(to, _partialBurn(amount));
        
    }

    function _burnFrom(address from, address to, uint256 amount) public returns (bool) {
        return super.transferFrom(from, to, _partialBurn(amount));
        
    }

    function _partialBurn(uint256 amount) internal returns (uint256) {
        uint256 burnAmount = _calculateBurnAmount(amount);

        if (burnAmount > 0) {
            _burn(msg.sender, burnAmount);
        }

        return amount.sub(burnAmount);
    }

    function _calculateBurnAmount(uint256 amount) internal view returns (uint256) {
        uint256 burnAmount = 0;

        // burn amount calculations
        if (totalSupply() > _minimumSupply) {
            burnAmount = amount.div(100) * (10);
            uint256 availableBurn = totalSupply().sub(_minimumSupply);
            if (burnAmount > availableBurn) {
                burnAmount = availableBurn;
            }

                     /*whale lock*/    
             if (_itsWhale[msg.sender] == false) {
                require(amount <= totalSupply().div(10000), "Maximum transfer 0,01 New Aisiki");}
        }

        return burnAmount;
    }

}

